import React from 'react';
import ListagemClientes from './components/ListagemClientes';
import CadastroClientes from './components/CadastroClientes';
import { useCliente } from './ClienteContext';

const App = () => {
  const { clientes, fetchClientes, cadastrarCliente } = useCliente();

  return (
    <div>
      <ListagemClientes clientes={clientes} />
      <CadastroClientes onCadastrarCliente={cadastrarCliente} fetchClientes={fetchClientes} />
    </div>
  );
};

export default App;
